import './App.css';

function App() {
  return (
    <div class="home">
      <div class="navigation">
        <div class="brand">
          <a href="./">Niyumi</a>
        </div>
        <div class="links">
          <a href="./">Home</a>
          <a href="./">Schedule</a>
          <a href="./">About</a>
        </div>
      </div>
      <div class="latest">

      </div>
    </div>
  );
}

export default App;
